import './App.css';
import Header from './components/Header.jsx';
import { Link } from 'react-router-dom';
function App() {
  return (
    <div className="min-h-screen bg-gray-50">
      <Header />
      <div className='flex flex-col justify-center h-dvh p-8'>
      <div className='flex justify-center'>
      <div className='flex flex-col items-center'>
            <h3 className='flex flex-co'>Ready to take control of your Financial Future?</h3>
        <div className='flex justify-center'>
        <Link to="/login">
                <button className="text-gray-600 hover:text-gray-900 px-4 py-2">Login</button>
              </Link>
              <Link to="/signup">
                <button className="bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800">Sign Up</button>
         </Link>
         </div>
        </div>
        </div>
      </div>
    </div>
  );
}

export default App;
